import React from "react";
import ReactDOM from "react-dom/client";
import car from "./Cars";

console.log(car);
const [duke, Crossfire] = car;

const {
  colorByPopularity: [color1, color2],
} = duke;

const {
  colorByPopularity: [cf_color1, cf_color2],
} = Crossfire;

const {
  speedStats: { topSpeed: dukeTopSpeed, zero_60: dukeInitial },
} = duke;

const {
  speedStats: { topSpeed: cfTopSpeed, zero_70: cf_initail },
} = Crossfire;
const root = ReactDOM.createRoot(document.getElementById("root"));

function Duke() {
  return (
    <>
      <table>
        <tr>
          <th>Name</th>
          <th>Top Speped</th>
          <th>0-60 (sec)</th>
          <th>Color</th>
          <th>Optional Color</th>
        </tr>
        <tr>
          <td>{duke.model}</td>
          <td> {dukeTopSpeed}</td>
          <td> {dukeInitial}</td>
          <td>{color1}</td>
          <td>{color2}</td>
        </tr>
        <tr>
          <td>{Crossfire.model}</td>
          <td>{cfTopSpeed}</td>
          <td> {cf_initail}</td>
          <td>{cf_color1}</td>
          <td>{cf_color2}</td>
        </tr>
      </table>
    </>
  );
}

export default Duke;
